let Alta = AltaAmenazaSismica.map(function(el) { return [el.lat, el.lng, 0]}).flat();
let Intermedia = IntermediaAmenazaSismica.map(function(el) { return [el.lat, el.lng, 0]}).flat();
let Intermedia2 = IntermediaAmenazaSismica2.map(function(el) { return [el.lat, el.lng, 0]}).flat();
let Intermedia3 = IntermediaAmenazaSismica3.map(function(el) { return [el.lat, el.lng, 0]}).flat();
let Baja = BajaAmenazaSismica.map(function(el) { return [el.lat, el.lng, 0]}).flat();
let Baja2 = BajaAmenazaSismica2.map(function(el) { return [el.lat, el.lng, 0]}).flat();


// THIS BLOCK SHOULD APPEAR ON EACH EXCLUSION ZONE CALCULATION .js
//--------------------------------------------------------------------------------------

// Obtains the checkbox object related to the population exclusion
let high_sismicity = document.getElementById('high_sismicity');
let medium_sismicity = document.getElementById('medium_sismicity');
let low_sismicity = document.getElementById('low_sismicity');


// If the box is checked at the program start, then draw
if (!high_sismicity.checked){
      draw_exclusion_sismicity('rgba(255, 0, 0, 0.2)', Alta);
}
if (!medium_sismicity.checked){
      draw_exclusion_sismicity('rgba(255, 255, 0, 0.2)', Intermedia);
      draw_exclusion_sismicity('rgba(255, 255, 0, 0.2)', Intermedia2);
      draw_exclusion_sismicity('rgba(255, 255, 0, 0.2)', Intermedia3);
}
if (!low_sismicity.checked){
      draw_exclusion_sismicity('rgba(0, 255, 0, 0.2)', Baja);
      draw_exclusion_sismicity('rgba(0, 255, 0, 0.2)', Baja2);
}

// Detects changes in the checkbox related to the population exclusion and "erase" by reloading or draws it
high_sismicity.addEventListener('change', (event) => {

  if (high_sismicity.checked){
    window.location.reload();
  } else {
      draw_exclusion_sismicity('rgba(255, 0, 0, 0.2)', Alta);
  }
})

// Detects changes in the checkbox related to the population exclusion and "erase" by reloading or draws it
medium_sismicity.addEventListener('change', (event) => {

      if (medium_sismicity.checked){
        window.location.reload();
      } else {
            draw_exclusion_sismicity('rgba(255, 255, 0, 0.2)', Intermedia);
            draw_exclusion_sismicity('rgba(255, 255, 0, 0.2)', Intermedia2);
            draw_exclusion_sismicity('rgba(255, 255, 0, 0.2)', Intermedia3);
      }
})

// Detects changes in the checkbox related to the population exclusion and "erase" by reloading or draws it
low_sismicity.addEventListener('change', (event) => {

      if (low_sismicity.checked){
        window.location.reload();
      } else {
            draw_exclusion_sismicity('rgba(0, 255, 0, 0.2)', Baja);
            draw_exclusion_sismicity('rgba(0, 255, 0, 0.2)', Baja2);
      }
})

//--------------------------------------------------------------------------------------

function draw_exclusion_sismicity(colors, coords){

      addPolygonToMapSism(map, coords, colors);   
}

// Function to draw polygons
function addPolygonToMapSism(map, coords, color) {

      var lineString = new H.geo.LineString(
            coords,
          'values lat lng alt');

      map.addObject(
      new H.map.Polygon(lineString, {
      style: {
            fillColor: color,
            strokeColor: color,
            lineWidth: 2,
            opacity: 0.1
            }
      }));  
}